import React from "react";
import './App.css'
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from "react-router-dom";
import NavBar from './components/NavBar';

function Routes() {
    return (
          <BrowserRouter>
            <NavBar />
            <Switch>
              <Route path="/about">
                <Dashboard />
              </Route>
              <Route path="/profile">
                <Preferences />
              </Route>
            </Switch>
          </BrowserRouter>
    );
  }

  export default Routes;
